// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
// NOT needed with > 0.8.0 import '@openzeppelin/contracts/utils/math/SafeMath.sol';
import "@openzeppelin/contracts/utils/math/Math.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/presets/ERC20PresetMinterPauser.sol";


contract OATToken is ERC20PresetMinterPauser, Ownable {


    string public _name = "OAT Token";
    string public _symbol = "OAT";
    uint8 public _decimals = 9;
    uint256 internal _reflectionTenthPercent = 5;
    uint256 internal _burnTenthPercent = 5 ;
    uint256 internal _period = 1;
    mapping(address => uint256) public poolClaimed;
    uint256 public tokenValueWEI;

    constructor() ERC20PresetMinterPauser(_name, _symbol) {

        _mint(msg.sender, 10 ** 12 * (10 ** uint256(decimals())));
    }

// getters and setters
    function getBurnTenthPercent() external view returns (uint256){
        return _burnTenthPercent;
    }
    function setBurnTenthPercent(uint256 burnTenthPercent) external onlyOwner {
        _burnTenthPercent = burnTenthPercent;
    }
    function getReflectionTenthPercent() external view returns (uint256){
        return _reflectionTenthPercent;
    }
    function setReflectionTenthPercent(uint256 reflectionTenthPercent) external onlyOwner {
        _reflectionTenthPercent = reflectionTenthPercent;
    }
    function getPeriod() external view returns (uint256) {
        return _period;
    }
    function setPeriod(uint256 q) external onlyOwner {
        _period = q;
    }
    function getTotalReflection() public view returns(uint256){
        return balanceOf(address(this));
    }
    function getUserReflection(address a) public view returns (uint256){
        if ( poolClaimed[a] == _period ){
            return 0;
        }
        return balanceOf(a) * getTotalReflection() / totalSupply(); // This is int divisions and rounds DOWN
    }
// claim reflections
    function claimAllReflection(uint256 amt) public onlyOwner {
        transferFrom( address(this), owner(), amt );
    }
    function claimReflection() external {
        address a = _msgSender();
        uint balance = getUserReflection(a);
        require(balance > 0, "No reflection available to be claimed");
        _transfer( address(this), a, balance );
        poolClaimed[a] = _period;
    }

    function setTokenValue(uint256 price) public onlyOwner {
        tokenValueWEI = price;
    }


    function buy(uint256 _amt) public payable{
        uint256 weiValue = _amt*tokenValueWEI;
        require(msg.value>weiValue,'no ETH sent');
        transfer(msg.sender,_amt);
    }
//overriden transfer
/**
* @dev See {IERC20-transfer}.
*
* Requirements:
*
* - recipient cannot be the zero address.
* - the caller must have a balance of at least amount.
*/
    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        require(balanceOf(_msgSender()) >= amount, "ERC20: transfer amount exceeds balance");
        uint256 burnAmt = 0;
        uint256 reflectionAmt = 0;
        if( owner() != _msgSender() && (_burnTenthPercent > 0 || _reflectionTenthPercent > 0) ){
        unchecked {
            burnAmt = Math.ceilDiv(amount * _burnTenthPercent,1000);
        }
        burn(burnAmt);
        unchecked {
        reflectionAmt = Math.ceilDiv(amount * _reflectionTenthPercent,1000);
        }
        _transfer(_msgSender(), address(this), reflectionAmt);
        }
        _transfer(_msgSender(), recipient, amount - burnAmt - reflectionAmt);
        return true;
    }
}
